import { useRoutes } from "react-router-dom";

import Layout from "./Layout";
import Sample from "./Sample";

export default function RoutingItems() {
let element = useRoutes([
    {

    path: "/",  element: <Layout /> }

         , {  
            path: "/sample", element: <Sample /> ,
       
    }
]);
return element;
}
